import React, { useState } from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';

const Home = () => {
  const [showProfile, setShowProfile] = useState(false);

  const toggleProfile = () => {
    setShowProfile(!showProfile);
  };

  return (
    <div>
      <header className='bg-light p-3'>
        <Container className='d-flex justify-content-between align-items-center'>
          <h1 className='mx-auto'>Chat App</h1>
          <Navbar expand="lg">
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav" className='justify-content-end'>
              <Nav>
                <Nav.Link href="#" onClick={toggleProfile}>Profile</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Navbar>
        </Container>
      </header>
      {showProfile && (
        <div className='container mt-4'>
          <div className='card'>
            <div className='card-body'>
              <h5 className='card-title'>User Details</h5>
              <p className='card-text'>Name: John Doe</p>
              <p className='card-text'>Email: johndoe@example.com</p>
            </div>
          </div>
        </div>
      )}
      <div className='container mt-4'>
        <div>Content of your home page goes here...</div>
      </div>
    </div>
  );
};

export default Home;
